class DatepickerComponent {
    constructor() {
        /** label pour le composant */
        this.dateLabel = 'Choisissez une date';
        /** positionnement de l'icone par rapport à l'input du date picker ?true suffix: false prefix */
        this.iconDatePickerPosition = true;
        /** class du composant */
        /**  => customClass = 'no-animate-label' si pas d'annimation */
        this.customClass = 'no-animate-label';
        this.sendDateChoosen = new EventEmitter();
    }
    onChange(event) {
        this.sendDateChoosen.emit(event);
    }
}
